import React, { PureComponent } from "react";

class DropDown2 extends PureComponent {
  constructor(props) {
    super(props);

    this.state = {
      isActive: false,
    };
  }

  render() {
    return (
      <div className="dropdown">
        <div>
          <h2 className="dropdown-header">
            <button
              className="accordian-btn round-corner"
              type="button"
              onClick={() => this.setState(!this.state.isActive)}
            >
              {this.props.displayItem}
            </button>
          </h2>
        </div>
      </div>
    );
  }
}

export default DropDown2;
